"use strict";(self.webpackChunkpt_library=self.webpackChunkpt_library||[]).push([[130],{7735:t=>{t.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"/17-09-2024 First post","metadata":{"permalink":"/blog/17-09-2024 First post","source":"@site/blog/17-09-2024 First post.md","title":"\u0627\u0644\u062a\u0627\u0631\u0648\u062a \u0648\u0623\u0647\u0645\u064a\u0629 \u0627\u0644\u062d\u062f\u0633","description":"alt text","date":"2024-09-21T13:16:07.208Z","tags":[],"readingTime":0.815,"hasTruncateMarker":false,"authors":[],"frontMatter":{},"unlisted":false},"content":"![alt text](/img/blog_images/woman_intuition.png)\\r\\n\\r\\n\u0627\u0644\u062a\u0627\u0631\u0648\u062a \u0647\u0648 \u0623\u062f\u0627\u0629 \u0642\u062f\u064a\u0645\u0629 \u062a\u064f\u0633\u062a\u062e\u062f\u0645 \u0644\u0627\u0633\u062a\u0643\u0634\u0627\u0641 \u0627\u0644\u0646\u0641\u0633 \u0648\u0641\u0647\u0645 \u0627\u0644\u0639\u0627\u0644\u0645 \u0645\u0646 \u062d\u0648\u0644\u0646\u0627. \u064a\u0639\u062a\u0645\u062f \u0627\u0644\u062a\u0627\u0631\u0648\u062a \u0639\u0644\u0649 \u0645\u062c\u0645\u0648\u0639\u0629 \u0645\u0646 \u0627\u0644\u0628\u0637\u0627\u0642\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u062d\u0645\u0644 \u0631\u0645\u0648\u0632\u064b\u0627 \u0648\u0645\u0639\u0627\u0646\u064a \u0645\u062e\u062a\u0644\u0641\u0629\u060c \u0648\u0643\u0644 \u0628\u0637\u0627\u0642\u0629 \u062a\u062d\u0645\u0644 \u0631\u0633\u0627\u0644\u0629 \u062e\u0627\u0635\u0629 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0633\u0627\u0639\u062f\u0646\u0627 \u0641\u064a \u0641\u0647\u0645 \u062c\u0648\u0627\u0646\u0628 \u0645\u062e\u062a\u0644\u0641\u0629 \u0645\u0646 \u062d\u064a\u0627\u062a\u0646\u0627.\\r\\n\\r\\n\u0623\u062d\u062f \u0623\u0647\u0645 \u0627\u0644\u062c\u0648\u0627\u0646\u0628 \u0641\u064a \u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u062a\u0627\u0631\u0648\u062a \u0647\u0648 \u0627\u0644\u0627\u0639\u062a\u0645\u0627\u062f \u0639\u0644\u0649 \u0627\u0644\u062d\u062f\u0633. \u0627\u0644\u062d\u062f\u0633 \u0647\u0648 \u0630\u0644\u0643 \u0627\u0644\u0634\u0639\u0648\u0631 \u0627\u0644\u062f\u0627\u062e\u0644\u064a \u0627\u0644\u0630\u064a \u064a\u0648\u062c\u0647\u0646\u0627 \u0646\u062d\u0648 \u0627\u0644\u0642\u0631\u0627\u0631\u0627\u062a \u0627\u0644\u0635\u062d\u064a\u062d\u0629 \u062d\u062a\u0649 \u0648\u0625\u0646 \u0644\u0645 \u0646\u0643\u0646 \u0646\u0645\u0644\u0643 \u0643\u0644 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a. \u0639\u0646\u062f\u0645\u0627 \u0646\u0633\u062a\u062e\u062f\u0645 \u0627\u0644\u062a\u0627\u0631\u0648\u062a\u060c \u0646\u062d\u0646 \u0644\u0627 \u0646\u0639\u062a\u0645\u062f \u0641\u0642\u0637 \u0639\u0644\u0649 \u0627\u0644\u0631\u0645\u0648\u0632 \u0648\u0627\u0644\u0645\u0639\u0627\u0646\u064a \u0627\u0644\u0645\u0643\u062a\u0648\u0628\u0629\u060c \u0628\u0644 \u0646\u0633\u062a\u062e\u062f\u0645 \u0623\u064a\u0636\u064b\u0627 \u062d\u062f\u0633\u0646\u0627 \u0644\u0641\u0647\u0645 \u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0627\u0644\u0645\u062e\u0641\u064a\u0629 \u0648\u0627\u0644\u062a\u0648\u062c\u064a\u0647\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u0642\u062f\u0645\u0647\u0627 \u0627\u0644\u0628\u0637\u0627\u0642\u0627\u062a.\\r\\n\\r\\n\u0627\u0644\u062d\u062f\u0633 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0643\u0648\u0646 \u0623\u062f\u0627\u0629 \u0642\u0648\u064a\u0629 \u0641\u064a \u062d\u064a\u0627\u062a\u0646\u0627 \u0627\u0644\u064a\u0648\u0645\u064a\u0629. \u064a\u0645\u0643\u0646\u0647 \u0623\u0646 \u064a\u0633\u0627\u0639\u062f\u0646\u0627 \u0641\u064a \u0627\u062a\u062e\u0627\u0630 \u0627\u0644\u0642\u0631\u0627\u0631\u0627\u062a \u0627\u0644\u0635\u0639\u0628\u0629\u060c \u0648\u0641\u0647\u0645 \u0645\u0634\u0627\u0639\u0631\u0646\u0627\u060c \u0648\u0627\u0644\u062a\u0648\u0627\u0635\u0644 \u0628\u0634\u0643\u0644 \u0623\u0641\u0636\u0644 \u0645\u0639 \u0627\u0644\u0622\u062e\u0631\u064a\u0646. \u0639\u0646\u062f\u0645\u0627 \u0646\u062b\u0642 \u0641\u064a \u062d\u062f\u0633\u0646\u0627\u060c \u0646\u062d\u0646 \u0646\u0641\u062a\u062d \u0627\u0644\u0628\u0627\u0628 \u0623\u0645\u0627\u0645 \u0625\u0645\u0643\u0627\u0646\u064a\u0627\u062a \u062c\u062f\u064a\u062f\u0629 \u0648\u0646\u0633\u0645\u062d \u0644\u0623\u0646\u0641\u0633\u0646\u0627 \u0628\u0623\u0646 \u0646\u0643\u0648\u0646 \u0623\u0643\u062b\u0631 \u062a\u0648\u0627\u0632\u0646\u064b\u0627 \u0648\u0633\u0644\u0627\u0645\u064b\u0627.\\r\\n\\r\\n\u0641\u064a \u0627\u0644\u0646\u0647\u0627\u064a\u0629\u060c \u0627\u0644\u062a\u0627\u0631\u0648\u062a \u0647\u0648 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0645\u062c\u0631\u062f \u0623\u062f\u0627\u0629 \u0644\u0644\u062a\u0646\u0628\u0624 \u0628\u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644. \u0625\u0646\u0647 \u0648\u0633\u064a\u0644\u0629 \u0644\u0644\u062a\u0648\u0627\u0635\u0644 \u0645\u0639 \u0623\u0646\u0641\u0633\u0646\u0627 \u0648\u0641\u0647\u0645 \u0627\u0644\u0639\u0627\u0644\u0645 \u0645\u0646 \u062d\u0648\u0644\u0646\u0627 \u0628\u0634\u0643\u0644 \u0623\u0639\u0645\u0642. \u0648\u0639\u0646\u062f\u0645\u0627 \u0646\u0633\u062a\u062e\u062f\u0645 \u062d\u062f\u0633\u0646\u0627 \u0641\u064a \u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u062a\u0627\u0631\u0648\u062a\u060c \u0646\u062d\u0646 \u0646\u0633\u0645\u062d \u0644\u0623\u0646\u0641\u0633\u0646\u0627 \u0628\u0627\u0644\u0627\u0633\u062a\u0641\u0627\u062f\u0629 \u0627\u0644\u0643\u0627\u0645\u0644\u0629 \u0645\u0646 \u0647\u0630\u0647 \u0627\u0644\u0623\u062f\u0627\u0629 \u0627\u0644\u0631\u0627\u0626\u0639\u0629."}]}}')}}]);